   },
   "source": [
    "## Business Task\n",
    "1. How do annual members and casual riders use Cyclistic bikes differently?\n",
    "2. Why would casual riders consider purchasing Cyclistic annual memberships?\n",
    "3. How can digital media be utilized to influence casual riders to become annual members at Cyclistic?"
   ]
