   "source": [
    "library(ggplot2)\n",
    "library(scales)  # For the comma function\n",
    "library(lubridate)\n",
    "library(dplyr)\n",
    "\n",
    "# Assuming 'Weekly' is a date or datetime\n",
    "bikerides2$Monthly <- lubridate::month(bikerides2$Weekly, label = TRUE, abbr = FALSE)\n",
    "\n",
    "# Enhanced Plotting\n",
    "bikerides2 %>%\n",
    "  ggplot(aes(x = Weekly, y = Count, fill = Monthly)) +  # Using fill for color\n",
    "  geom_col() +  # Removed show.legend = FALSE to show the legend\n",
    "  scale_fill_brewer(palette = \"Set3\") +  # A color palette for visual appeal\n",
    "  scale_y_continuous(labels = comma) +\n",
    "  labs(\n",
    "    title = \"Count of Rides per Day\",\n",
    "    subtitle = \"Based on 28-day moving average\",\n",
    "    x = \"Week\",\n",
    "    y = \"Average Rides per Day\",\n",
    "    fill = \"Month\"  # Custom legend title for 'fill' aesthetic\n",
    "  ) +\n",
    "  theme_minimal() +  # Clean, minimal theme\n",
    "  theme(\n",
    "    plot.title = element_text(size = 16, face = \"bold\"),\n",
    "    plot.subtitle = element_text(size = 12),\n",
    "    axis.text.x = element_text(angle = 45, hjust = 1, size = 10),  # Rotate x-axis text for better readability\n",
    "    axis.title = element_text(size = 14, face = \"bold\"),\n",
    "    axis.text = element_text(size = 12),  # Adjusting text size for readability\n",
    "    legend.position = \"right\"  # You can change the legend position if needed\n",
    "  )\n"
   ]
