   "source": [
    "library(ggplot2)\n",
    "library(scales)\n",
    "\n",
    "# Faceted Line Plot with Adjusted Spacing and Rotated X-axis Labels\n",
    "bikerides2 %>% \n",
    "  ggplot(aes(x = Weekly, y = Count, group = Monthly, color = as.factor(Monthly))) + \n",
    "  geom_line() + \n",
    "  scale_color_viridis_d() +  # A vibrant color palette\n",
    "  facet_wrap(~Monthly, scales = \"free_x\") + \n",
    "  scale_y_continuous(labels = comma) +\n",
    "  labs(\n",
    "    title = \"Count of Rides Per Week\",\n",
    "    subtitle = \"Faceted by Month, Based on 28-day Moving Average\",\n",
    "    x = \"Week\",\n",
    "    y = \"Average Rides per Week\"\n",
    "  ) +\n",
    "  theme_minimal() + \n",
    "  theme(\n",
    "    plot.title = element_text(size = 14, face = \"bold\"),\n",
    "    plot.subtitle = element_text(size = 12),\n",
    "    legend.title = element_blank(),  # Hides the legend title\n",
    "    panel.spacing = unit(2, \"lines\"),  # Adjust space between panels\n",
    "    strip.text.x = element_text(size = 8),  # Adjust facet label text size if needed\n",
    "    axis.text.x = element_text(angle = 45, hjust = 1)  # Rotate x-axis text\n",
    "  )"
   ]
