    "library(ggplot2)\n",
    "library(scales)  # For the comma function\n",
    "\n",
    "# Assuming bikerides2 and start_hour are properly defined\n",
    "bikerides2 %>%\n",
    "  ggplot(aes(x = start_hour, y = Count, fill = factor(start_hour))) +\n",
    "  geom_col() +  # Removed show.legend = FALSE to enable legend\n",
    "  scale_fill_viridis_d() +  # A vibrant color palette\n",
    "  scale_y_continuous(labels = comma) +\n",
    "  labs(\n",
    "    title = \"Count of Rides by Hours\",\n",
    "    subtitle = \"Distribution of Rides Across Different Hours of the Day\",\n",
    "    x = \"Hour of the Day\",\n",
    "    y = \"Rides per Hour\",\n",
    "    fill = \"Start Hour\"  # Label the legend appropriately\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    plot.title = element_text(size = 14, face = \"bold\"),\n",
    "    plot.subtitle = element_text(size = 12),\n",
    "    axis.text.x = element_text(angle = 45, hjust = 1),  # Rotate x-axis text for better readability\n",
    "    axis.title = element_text(size = 12, face = \"bold\"),\n",
    "    legend.position = \"right\"  # Adjust if needed\n",
    "  ) +\n",
    "  scale_x_continuous(breaks = 0:23)  # Assuming start_hour is in 0-23 format\n"
   ]
  },
