    "bikestype <- bike_rides %>%\n",
    "  group_by(member_casual, rideable_type, Weekly = floor_date(Ymd, \"week\")) %>%\n",
    "  summarise(\n",
    "    Minutes = sum(Minutes),\n",
    "    Mean = mean(Minutes),\n",
    "    Median = median(Minutes),\n",
    "    Max = max(Minutes),\n",
    "    Min = min(Minutes),\n",
    "    Count = n(),\n",
    "    .groups = 'drop'  # This will drop the automatic regrouping\n",
    "  )\n"
   ]
  },
