   "source": [
    "library(ggplot2)\n",
    "library(scales)  # For the comma function\n",
    "\n",
    "# Enhanced Area Plot with Improved Aesthetics\n",
    "ggplot(bikestype, aes(x = Weekly, y = Count, fill = rideable_type)) +\n",
    "  geom_area(alpha = 0.7) +  # Adjust transparency with alpha\n",
    "  scale_fill_brewer(palette = \"Set1\") +  # A color palette for different rideable types\n",
    "  scale_y_continuous(labels = comma) +\n",
    "  labs(\n",
    "    title = \"Count of Rides by Bike Type\",\n",
    "    subtitle = \"For 12 Months (Ending 2021-03-31)\",\n",
    "    x = \"Week\",\n",
    "    y = \"Rides Count\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    plot.title = element_text(size = 16, face = \"bold\"),\n",
    "    plot.subtitle = element_text(size = 14),\n",
    "    legend.title = element_text(size = 12),\n",
    "    axis.text = element_text(size = 12),\n",
    "    axis.title = element_text(size = 14, face = \"bold\")\n",
    "  ) +\n",
    "  guides(fill = guide_legend(title = \"Bike Type\"))  # Customizing the legend"
   ]
  },
