   "source": [
    "library(ggplot2)\n",
    "library(scales)  # For the comma function\n",
    "library(RColorBrewer)  # For more color palettes\n",
    "library(dplyr)  # Ensure dplyr is loaded for the %>% operator\n",
    "\n",
    "# Your existing code follows here\n",
    "# Assuming bikestype and its columns Weekly, Minutes, and rideable_type are properly defined\n",
    "ggplot(bikestype, aes(x = Weekly, y = Minutes, fill = rideable_type)) +\n",
    "  geom_col() +  # Removed show.legend = FALSE to enable legend\n",
    "  scale_fill_brewer(palette = \"Dark2\") +  # An attractive color palette\n",
    "  scale_y_continuous(labels = comma) +\n",
    "  facet_wrap(~ rideable_type, scales = \"free_x\") +\n",
    "  labs(\n",
    "    title = \"Total Ride Minutes by Week\",\n",
    "    x = \"Week\",\n",
    "    y = \"Total Minutes\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    plot.title = element_text(size = 16, face = \"bold\"),\n",
    "    axis.text.x = element_text(angle = 45, vjust = 0.5, hjust = 1),  # Rotate x-axis text for better readability\n",
    "    axis.title = element_text(size = 14, face = \"bold\"),\n",
    "    strip.text.x = element_text(size = 12)\n",
    "  )\n"
   ]
