   "source": [
    "library(ggplot2)\n",
    "library(scales)  # For the comma function\n",
    "\n",
    "# Enhanced Area Plot\n",
    "ggplot(bikestype, aes(x = Weekly, y = Count, fill = member_casual)) +\n",
    "  geom_col(alpha = 0.6, position = \"stack\") +  # Adjust transparency with alpha, stack areas\n",
    "  scale_fill_brewer(palette = \"Set2\") +  # A color palette for different member types\n",
    "  scale_y_continuous(labels = comma) +\n",
    "  labs(\n",
    "    title = \"Count of Rides by Rider Type\",\n",
    "    subtitle = \"Weekly Distribution of Rides for Different Rider Types\",\n",
    "    x = \"Week\",\n",
    "    y = \"Ride Count\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    plot.title = element_text(size = 16, face = \"bold\"),\n",
    "    plot.subtitle = element_text(size = 14),\n",
    "    axis.text.x = element_text(angle = 45, vjust = 0.5, hjust = 1),  # Rotate x-axis text\n",
    "    axis.title = element_text(size = 14, face = \"bold\"),\n",
    "    legend.title = element_text(size = 12)\n",
    "  ) +\n",
    "  guides(fill = guide_legend(title = \"Rider Type\"))  # Customizing the legend\n"
   ]
