   "source": [
    "library(ggplot2)\n",
    "library(scales)  # For the comma function\n",
    "\n",
    "# Corrected Area Plot\n",
    "ggplot(bikestype, aes(x = Weekly, y = Minutes, fill = rideable_type)) +\n",
    "  geom_area(stat = \"identity\", alpha = 0.75) +  # Use alpha for transparency\n",
    "  scale_y_continuous(labels = comma) +\n",
    "  labs(\n",
    "    title = \"Rides Minutes by Bike Type and Week\",\n",
    "    x = \"Week\",\n",
    "    y = \"Bike Trip In Minutes\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    plot.title = element_text(size = 16, face = \"bold\"),\n",
    "    axis.text.x = element_text(angle = 45, vjust = 0.5, hjust = 1),  # Rotate x-axis text for readability\n",
    "    axis.title = element_text(size = 14, face = \"bold\"),\n",
    "    legend.title = element_text(size = 12)\n",
    "  )"
   ]
