   "source": [
    "library(ggplot2)\n",
    "library(dplyr)\n",
    "\n",
    "# Enhanced Bar Chart with Improved Aesthetics\n",
    "bike_rides %>%\n",
    "  count(start_station_name, sort = TRUE) %>%\n",
    "  top_n(20) %>%\n",
    "  ggplot(aes(x = reorder(start_station_name, n), y = n, fill = start_station_name)) + \n",
    "  geom_col(show.legend = FALSE) +\n",
    "  scale_y_continuous(labels = comma) +\n",
    "  coord_flip() +  # Flipping the coordinates for horizontal bars\n",
    "  scale_fill_viridis_d() +  # A vibrant color palette\n",
    "  labs(\n",
    "    title = \"Top 20 Start Stations by Ride Count\",\n",
    "    x = \"Start Station Name\",\n",
    "    y = \"Station Name\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    plot.title = element_text(size = 16, face = \"bold\"),\n",
    "    axis.text.x = element_text(size = 12),\n",
    "    axis.text.y = element_text(size = 12),\n",
    "    axis.title.x = element_text(size = 14, face = \"bold\"),\n",
    "    axis.title.y = element_text(size = 14, face = \"bold\")\n",
    "  )"
   ]
